import React from 'react';
import { Route } from 'react-router-dom';
import {RentContainer} from '../../elements/Container';
import VentaCards from '../../layout/VentaCards';
import Renta from './Renta';
import ItemList from '../items/ItemList';
import ItemDetail from '../items/ItemDetail';

const Venta = ({className, salePrice}) => {
    return (
        <>
        <RentContainer className={className}>                     

              <Route exact path={`/venta/`} component={VentaCards}/>
              <Route 
                exact path={`/venta/:catalogo`}                 
                render={(props) => (
                    <Renta {...props} salePrice={true} />
                  )}
                /> 
               <Route 
                exact path={`/items/:category`}                 
                render={(props) => (
                    <ItemList {...props} price={salePrice} />
                  )}
                />
              <Route 
                exact path={`/items/:category/:id`}                
                render={(props) => (
                    <ItemDetail {...props} salePrice={salePrice} />
                  )}
                />           
        </RentContainer> 
        </>
    );
};

export default Venta;
